import React from 'react';
import { NavLink } from 'react-router-dom';
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import LogoutButton from './auth/LogoutButton';
import lexflixLogo from '../images/lexflixLogo.png';
import './NavBar.css'

const NavBar = () => {
  const sessionUser = useSelector(state => state.session.user);


  return (
    <div className='outer-nav-bar'>
      <Link to='/' exact={true} className='outer-logo'>
        <img src={lexflixLogo} alt='logo' className='logo' />
      </Link>
      <div className='action-outer-'>
        {
          !sessionUser &&
          <button>
            <Link to='/login' exact={true}>
              Sign In
            </Link>
          </button>
        }
        {
          sessionUser &&
          // <div>
          //   <NavLink to='/profiles' exact={true} className='prof-text'>
          //     Profiles
          //   </NavLink>
          <LogoutButton />
          // </div>
        }
      </div>
    </div>
  );
}

export default NavBar;
